import React from 'react';
// import { Outlet } from 'react-router-dom';
import { Link, Outlet } from 'react-router-dom';

import Header from "../../components/Header/Header"
import Footer from "../../components/Footer/Footer";


// const setActive = ({isActive}) => isActive ? "active-link" : "";


const MainPagesLayout = () => {
    return (
        <>
            <Header>
            <Link to="/"  style>Главная</Link>
            <Link to="/test" activeClassName='active'>Онлайн-тест</Link>
            <Link to="/posts" activeClassName='active'>Последние изменения</Link>
            <Link to="/education" activeClassName='active'>Обучающие видео</Link>
            </Header>  
            <Outlet />
            <Footer />
        </>
    );
};

export default MainPagesLayout;
